import "date"

from(bucket: "${Bucket}")
  |> range(start: v.timeRangeStart, stop: v.timeRangeStop)
  |> filter(fn: (r) => r["_measurement"] == "snmp")
  |> filter(fn: (r) => r["_field"] == "output_load_percent")
  |> map(
      fn: (r) => ({
        r with _value:
          if date.month(t: r._time) >= 6 and date.month(t: r._time) <= 9 then 
            (((float(v: r._value) * 19.2) / 1000.0) / 60.0) * ${summer_electricity_price}
          else
            (((float(v: r._value) * 19.2) / 1000.0) / 60.0) * ${winter_electricity_price}
      })
  )
  |> aggregateWindow(every: v.windowPeriod, fn: last, createEmpty: false)
  |> yield(name: "last")

